import React,{Component} from 'react';
import "./index.scss"
class Index extends Component{
        state ={
            data:'å­™å‰‘'
        }
        componentDidMount() {
            fetch("http://47.100.98.54:9020/api/name")
                .then(res=>res.json())
                .then((data)=>{
                    if(data.status === 200){
                        this.setState({
                            data:data.name
                        })
                    }
                })
        }


    render() {
        return(
            <header className={"hh"}>
                <div className={"logo"}>
                    <img src="data:image/png;base64," alt="#"/>
                </div>
                <div className={"search"}>
                    <i className={"iconfont icon-search1"}></i>
                    <span>666+</span>
                </div>
                <div className={"login iconfont icon-wode"}></div>
            </header>
        )
    }
}
export default Index;